import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Layout from './Layout';
import ViewAbout from "./ViewAbout";

const App = () => {
    return ( 
        <BrowserRouter>
            <Switch>
                <Route  path="/" exact>
                    <Layout />
                </Route>
                <Route  path="/ViewAbout" exact >
                    <ViewAbout />
                </Route>
            </Switch>
        </BrowserRouter>
        
    )
}

export default App;
